export const ChannelContext = React.createContext()
export const Cont1 = () => {
  return (
    <div>
        <UserContext.Provider value={"Girish"}>
            <ChannelContext.Provider value={"Qspiders"}>
                <Cont2/>
            </ChannelContext.Provider>
        </UserContext.Provider>
    </div>
  )
}
